import "../styles/menu.css";

const MenuPage = () => {
  return (
    <div>
      <header className="top-header">
        <div className="logo">
          <img src="/logo.png" alt="Deep Net Soft Logo" />
        </div>
        <nav className="nav-menu">
          <Link to="/">HOME</Link>
          <Link to="/food">FOOD</Link>
          <Link to="/drinks">DRINKS</Link>
          <a href="#">MAKE A RESERVATION</a>
          <a href="#">CONTACT US</a>
        </nav>
      </header>

      <section className="menu-tabs">
        <Link to="/food"><button>FOOD</button></Link>
        <Link to="/drinks"><button className="active">DRINKS</button></Link>
      </section>

      <footer className="footer">
        <p>Â© 2024 Deepnetsoft Solutions. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default MenuPage;
